import React from 'react';

const MovieList = ({ user }) => {
  const { picture, firstName, lastName } = user;
  return (
    <div className='bg-white rounded shadow p-3 h-100 image-container'>
      <img src={picture} className='mb-3' width="130" />
      <div className='h6 mt-2 mb-0 text-truncate'>{ firstName } { lastName } </div>
      <div className='border-top mt-2 pt-2 text-left'>
        <div className='out-a small pointer text-underline '>
         Full Profile
        </div>
        <div className='out-a small pointer text-underline'>Posts List</div>
      </div>
    </div>
  );
};

export default MovieList;
